import React from "react";
import { Box, Typography } from "@mui/material";
import TourContent from "./tour_content";

export default function Tours({ tours }) {
  return (
    <Box
      sx={{
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        textAlign: "center",
        width: "100vw",
        height: "100vh",
      }}
    >
      <Typography
        variant="h2"
        fontWeight="bold"
        sx={{
          color: "red",
          display: "inline",
          textDecoration: "underline wavy cyan 10",
        }}
      >
        <Typography
          variant="h2"
          sx={{ display: "inline", textDecoration: "underline #C00E53" }}
        >
          Our Tours
        </Typography>
      </Typography>
      <div>
        {tours.map((tour) => {
          return <TourContent key={tour.id} {...tour}></TourContent>;
        })}
      </div>
    </Box>
  );
}
